import React, { useEffect, useState, useRef } from 'react';






const [coordinates, setCoordinates] = useState([]);

useEffect(() => {
  const coordinates = JSON.parse(localStorage.getItem('coordinates'));
  if (coordinates) {
   setCoordinates(coordinates);
  }
}), [];
